import {LOGIN_COUNTER, LOGIN_EMAIL, LOGIN_PASSWORD, LOGIN_USERNAME} from "../../config/type";


const initialState = {
  email: "",
  password: "",
  username: "",
  counter: 0
}

export default (state = initialState, action) => {
  switch (action.type) {
    case LOGIN_EMAIL:
      return {...state, action}
    case LOGIN_PASSWORD:
      return {...state, action}
    case LOGIN_USERNAME:
      return {...state, action}
    case LOGIN_COUNTER:
      return {...state, action}
    default:
      return state
  }
}
